import styles from './ChecklistPresent.module.css';


function ChecklistPresent({month, year, eventId, eventText}) {

function addZero(num) {
   if(num >= 1 && num <= 9) {
    return '0' + num;
   }
}

return <div className={styles.container}>
    <h3>Список справ/подій на {eventText}.{addZero(month)}.{year}</h3>

</div>

}

export default ChecklistPresent;
